import { React } from "react";
import { useNavigate } from "react-router-dom";

function Homepage() {
  const history = useNavigate();
  return (
    <div class="homepage">
      <h1>HOME</h1>
      <button onClick={history("/vendorlogin")}>VENDORS</button>
      <button onClick={history("/studentlogin")}>STUDENTS</button>
    </div>
  );
}

export default Homepage;
